    insert into club VALUES (NULL, 'FORMULA UEM', 'El equipo está formado por estudiantes de ingenieria, diseño, marketing, negocios... interesados en el mundo del motorsport y que están buscando un reto. Trabajamos en el diseño y fabricación de un monoplaza para competir contra otras universidades tanto a nivel nacional como internacional.', 'clubF1UEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CLUB INFORMÁTICA', 'Somos un club multidisciplinar basado en proyectos de nuevas tecnologías como loT Cloud, drones, etc., además de los propios de la informática y la programación.', 'clubPROGRAMACIONUEM@GMAIL.COM',now(), NULL, NULL,'Canarias');
    insert into club VALUES (NULL, 'IRL CLUB', 'En el Club de Relaciones Internacionales, somos un grupo diverso de estudiantes de diferentes partes del mundo, que nos hemos reunido por nuestro gran interés en las Relaciones Internacionales. Realizamos entrevistas en directo en Instagram, debates...', 'clubDEBATESUEM@GMAIL.COM',now(), NULL, NULL,'Valencia');
    insert into club VALUES (NULL, 'GAME STUDIO 2.0', 'Unimos arte, diseño y programación para la creación de videojuegos. Organizamos cursos de programación con Gamemaker, game jams, torneos de e-sports, etc.', 'clubVIDEOJUEGOSUEM@GMAIL.COM',now(), NULL, NULL,'Alcobendas');
    insert into club VALUES (NULL, 'BDE KINESPAÑA', 'Queremos ser parte de la integración de los nuevos y futuros estudiantes de Fisioterapia, a través de diversas actividades recreativas y eventos deportivos. Nuestro objetivo es ayudar a los estudiantes en Su paso por la universidad y que se sientan el orgullo de ser parte de la Universidad Europea de Madrid', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CLUB ROBOTICS', 'Creamos desde cero sistemas robóticos así como el manejo de sistemas ya desarrollados. Participamos en concursos de robótica como el ASTIC hallenge, proyectos independientes como el Robot Araña, etc.', 'clubroboticsuem@gmail.com',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CRIPTO CLUB', 'Queremos explorar el potencial que tiene la tecnologia del blockchain y la descentralización para cambiar la economia tal y como la conocemos. Estudia lo aspectos fundamentales e importantes relacionados con la economía descentralizada para mejorar la toma de decisiones.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'UEM E-SPORTS', 'Nos apasionan los deportes electrónicos y queremos ofrecer a la comunidad de la Universidad Europea de Madrid eventos y competencias de e-sports. Nos definimos como unos "frikis" que se reúnen para jugar a videojuegos en comunidad.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CLUB AIR DIVISION', 'Diseñamos y fabricamos drones,. y actualmente estamos preparando el lanzamiento del satélite a través del proyecto PicoSat mediante colaboradores. Visitamos centros del sector aeronáutico y aeroespacial.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'RUNNING CLUB', 'Si te apasiona correr, quieres ponerte en forma y conocer gente, ieste es tu club! Podrás disfrutar de entrenamientos semanales guiados por un instructor de running titulado. Entrena con nosotros, consigue dorsales en carreras seleccionadas y tu equipamiento deportivo de la Universidad Europea de Valencia.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'WORKOUT VALENCIA', 'Para los que no pueden estar quietos. Entrenamientos semanales para todas las edades y todos los niveles, lo importante es que tengas ganas de estar en forma y de pasarlo bien al aire libre, y sin necesidad de equipamiento.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CHESS CLUB', 'No importa si llevas mucho tiempo jugando al ajedrez o si quieres aprender, en el Chess Club queremos unir a todos los estudiantes entornoa este juego. Forma parte de nuestro club y te la oportunidad de compartir con estudiantes de todas las titulaciones mientras desarrollas tus habilidades con el ajedrez.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'ASOCIACIÓN DE ODONTOLOGÍA', 'Por y para los estudiantes. Queremos proporcionar conocimientos, experiencias y ser un punto de encuentro para los estudiantes de Odontología de la Universidad Europea de Madrid.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'AEMUEM', 'Unete a la Asociación de Estudiantes de Medicina UEM! Si estudias Medicina y quieres relacionarte con otros estudiantes de tu Facultad fuera de las clases, con proyectosyactividades que te interesen. Además, la Asociación representa tu voz y tu opinión.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'UEPSA', 'En la Universidad Europea Psychology Student Association, nuestro objetivo es promover la salud mental y combatir el estigma de las enfermedades mentales. Para fomentar la relación entre los miembros, organizamos debates y otras actividades sociales como cinefórums y picnics en el parque.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'DENTALIFE', 'DentaLife es un club dedicado a la vida estudiantil de los futuros dentistas de la UEM. Nuestro objetivo es promover la cohesión de los estudiantes mediante la creación de eventos festivos, culturales y deportivos.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'PHYSX', 'Somos un club que se enfrenta a retos enfocados al área de la física e intentar darles sentido a los datos obtenidos, no tenemos límites, actualmente estamos reconstruyendo una caseta meteorológica, también estamos con la construcción de un contador Geiger.', 'PHYSX@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CLUB DE CIENCIA', 'Preparamos actividades, talleres e iniciativas relacionadas con el mundo de la ciencia. Es un lugar donde promovemos las aplicaciones de las Ciencias y desarrollamos nuevas habilidades de una forma divertida y amena.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CLUB MUN ', 'Queremos crear un espacio universitario donde los estudiantes del mundo puedan poner en práctica las teorías aprendidas en clases y las teorías metodológicas de las relaciones internacionales, a través de Modelos de Naciones Unidas y distintos organismos globales.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'PRIDE UE', 'Si estás buscando un espacio dónde aprender, compartir y vivir experiencias dentro de la comunidad LGTBIQ+, este es tu club. Nuestro objetivo principal es crear un espacio abierto para todas aquellas personas que sean del colectivo, lo apoyen o simplemente quieran conocerlo más.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CLUB DE ROL', 'Un espacio donde puedes reforzar tu creatividad y tus capacidades de improvisación a la vez que aprendes competencias relacionadas con el ambiente narrativo y de diseño encontrado en diversos estudios de videojuegos. Organizamos diversos talleres y partidas de rol.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CLUB DE TEATRO', 'Te apasiona la actuación? ¿Quieres descubriro desarrollar tus talentos? Sé parte del Club de Teatro y vive la experiencia de representar una obra. Cada semana aprenderás lo que ocurre en el proceso de montaje de una obra de teatro y la experiencia desde el punto de vista de los actores.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'CLUB DE FOTOGRAFÍA', ' Si te interesa la fotografía, la creación de videos, la escritura de guiones o incluso el manejo de drones con fines audiovisuales, este es tu club. Somos un grupo de estudiantes con interés en aprender y poner en práctica conocimientos sobre el mundo audiovisual.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'UECC', '¡Hablemos de cine! El objetivo del Universidad Europea Cinema Club es llegar a conocer más sobre el séptimo arte y compartir ideas sobre películas desde diversos enfoques como la filosofia, la cinematografía, la psicología, etc. Es un entorno en el que debatimos e intercambiamos nuestras perspectivas sobre el tema.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
    insert into club VALUES (NULL, 'PSYCLUB', 'Somos un grupo de alumnos que tiene como objetivo la divulgación de información cientifica mediante charlas y actividades en las que los alumnos y alumni de la UE pueden participar. Buscando asi romperlos estigmas, mitos y desinformación con respecto a la psicologia, ¿Te interesa? Siguenos en instogrom y entérate de las actividades mensudles.', 'clubFISIOTERAPIAUEM@GMAIL.COM',now(), NULL, NULL,'Villaviciosa');
